import React, { useState, useEffect } from "react";
import "./App.css";
import Axios from "axios";

function App() {
  // this is the function called when the "Submit Name" button is clicked

  return (
    <div className="App">
      <div className="registration">
        <h1>Registration</h1>
        <input type="text" placeholder="Username" />
        <input type="text" placeholder="Password" />
        <button>Register</button>
      </div>
      <div className="login">
        <h1>Login</h1>
        <input type="text" placeholder="Username" />
        <input type="text" placeholder="Password" />
        <button>Login</button>
      </div>
    </div>
  );
}

export default App;
